import React from 'react';

const FlightInfo = ({ routeInfo }) => {
  // Check if routeInfo is defined and not empty
  if (!routeInfo || Object.keys(routeInfo).length === 0) {
    return null;
  }

  // Destructure routeInfo object
  const {
    departureTime,
    arrivalTime,
    distance,
    price,
    flightID,
    companyName,
    origin,
    destination,
  } = routeInfo;

  // Calculate flight duration in days
  const departureDate = new Date(departureTime);
  const arrivalDate = new Date(arrivalTime);
  const flightDurationDays = Math.floor((arrivalDate - departureDate) / (1000 * 60 * 60 * 24));

  // Render FlightInfo component
  return (
    <div className="flight_info_body">
      <div className="flight_info_body_item">
        <h2>Departure time</h2>
        <p>{departureDate.toLocaleString()}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Arrival time</h2>
        <p>{arrivalDate.toLocaleString()}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Duration</h2>
        <p>{flightDurationDays} days</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Distance</h2>
        <p>{distance} km</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Cost</h2>
        <p>${price}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Flight ID</h2>
        <p>{flightID}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Company Name</h2>
        <p>{companyName}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Origin</h2>
        <p>{origin}</p>
      </div>
      <div className="flight_info_body_item">
        <h2>Destination</h2>
        <p>{destination}</p>
      </div>
    </div>
  );
};

export default FlightInfo;
